/* Procedure structure for procedure `sp_get_closely_driver_v01` */

/*!50003 DROP PROCEDURE IF EXISTS  `sp_get_closely_driver_v01` */;

DELIMITER $$

/*!50003 CREATE DEFINER=`root`@`localhost` PROCEDURE `sp_get_closely_driver_v01`(
IN para_grade_sub_code VARCHAR(50),
IN para_region_code VARCHAR(50),
IN para_latitude decimal(15,7),
IN para_longitude decimal(15,7)
)
BEGIN
SELECT driver_user_id,registration_id,grade_sub_code,district_id,region_code,district_name_eng,
gps_latitude,
gps_longitude,
(lat_diff + long_diff) AS diff
 FROM 
(SELECT driver_user_id,registration_id,grade_sub_code,district_id,region_code,district_name_eng,
gps_latitude,if(gps_latitude>para_latitude, gps_latitude-para_latitude, para_latitude-gps_latitude) AS lat_diff, 
gps_longitude,
if(gps_longitude >para_longitude, gps_longitude-para_longitude, para_longitude-gps_longitude ) AS long_diff
FROM v_driver_online WHERE region_code=para_region_code
AND CASE
	WHEN para_grade_sub_code='HK_CAR_BLACK_SEAT_4' THEN grade_sub_code <>'HK_CAR_X_SEAT_4' 
	WHEN para_grade_sub_code='HK_CAR_BLACK_SEAT_7' THEN grade_sub_code ='HK_CAR_BLACK_SEAT_7' 
	ELSE 1=1
	END
 )  AS sb 
ORDER BY diff LIMIT 20 ;
END */$$
DELIMITER ;

/* Procedure structure for procedure `sp_get_district_v01` */

/*!50003 DROP PROCEDURE IF EXISTS  `sp_get_district_v01` */;

DELIMITER $$

/*!50003 CREATE DEFINER=`root`@`localhost` PROCEDURE `sp_get_district_v01`(IN para_latitude decimal(15,7),IN para_longitude decimal(15,7))
BEGIN
select district_id,region_code,district_name_eng,district_name_chn,
center_latitude,
center_longitude,
(lat_diff + long_diff) as diff
 from 
(select district_id,region_code,district_name_eng,district_name_chn,
center_latitude,if(center_latitude>para_latitude, center_latitude-para_latitude, para_latitude-center_latitude) as lat_diff, 
center_longitude,
if(center_longitude >para_longitude, center_longitude-para_longitude, para_longitude-center_longitude ) as long_diff
from tbl_oms_geo_district_master)  as sb
order by diff limit 1 ;
END */$$
DELIMITER ;

/* Procedure structure for procedure `sp_get_request_nearly_driver_v02` */

/*!50003 DROP PROCEDURE IF EXISTS  `sp_get_request_nearly_driver_v02` */;

DELIMITER $$

/*!50003 CREATE DEFINER=`root`@`localhost` PROCEDURE `sp_get_request_nearly_driver_v02`(
IN para_grade_sub_code VARCHAR(50),
IN para_region_code VARCHAR(50),
IN para_latitude decimal(15,7),
IN para_longitude decimal(15,7),
IN para_filter_driver_user_id varchar(200)
)
BEGIN
SELECT driver_user_id,registration_id,grade_sub_code,district_id,region_code,district_name_eng,
gps_latitude,
gps_longitude,
(lat_diff + long_diff) AS diff, now() as 'test'
 FROM 
(SELECT driver_user_id,registration_id,grade_sub_code,district_id,region_code,district_name_eng,
gps_latitude,if(gps_latitude>para_latitude, gps_latitude-para_latitude, para_latitude-gps_latitude) AS lat_diff, 
gps_longitude,
if(gps_longitude >para_longitude, gps_longitude-para_longitude, para_longitude-gps_longitude ) AS long_diff
FROM v_driver_online WHERE region_code=para_region_code
AND CASE
	WHEN para_grade_sub_code='HK_CAR_BLACK_SEAT_4' THEN grade_sub_code <>'HK_CAR_X_SEAT_4' 
	WHEN para_grade_sub_code='HK_CAR_BLACK_SEAT_7' THEN grade_sub_code ='HK_CAR_BLACK_SEAT_7' 
	ELSE 1=1
	END
AND CASE
	WHEN para_filter_driver_user_id<>'' THEN driver_user_id NOT IN (para_filter_driver_user_id) 
	ELSE 1=1
	END
 )  AS sb 
ORDER BY diff LIMIT 1 ;
END */$$
DELIMITER ;

/* Procedure structure for procedure `sp_get_resv_order_district_v01` */

/*!50003 DROP PROCEDURE IF EXISTS  `sp_get_resv_order_district_v01` */;

DELIMITER $$

/*!50003 CREATE DEFINER=`root`@`localhost` PROCEDURE `sp_get_resv_order_district_v01`(IN para_latitude decimal(15,7),IN para_longitude decimal(15,7))
BEGIN
select district_id,region_code,region_name_eng,region_name_chn,district_name_eng,district_name_chn,
center_latitude,
center_longitude,
(lat_diff + long_diff) as diff
 from 
(select d.district_id,d.region_code,r.region_name_eng, r.region_name_chn,d.district_name_eng,d.district_name_chn,
d.center_latitude,if(d.center_latitude>para_latitude, d.center_latitude-para_latitude, para_latitude-d.center_latitude) as lat_diff, 
d.center_longitude,
if(d.center_longitude >para_longitude, d.center_longitude-para_longitude, para_longitude-d.center_longitude ) as long_diff
from tbl_resv_order_geo_district_master as d
LEFT JOIN tbl_resv_order_geo_region_master AS r ON d.region_code=r.region_code )  as sb
order by diff limit 1 ;
END */$$
DELIMITER ;

/* Procedure structure for procedure `sp_insert_driver_gps_v01` */

/*!50003 DROP PROCEDURE IF EXISTS  `sp_insert_driver_gps_v01` */;

DELIMITER $$

/*!50003 CREATE DEFINER=`root`@`localhost` PROCEDURE `sp_insert_driver_gps_v01`(
IN para_driver_user_id BIGINT(20),
IN para_middle_core_server_code VARCHAR(50),
IN para_middle_slave_server_code VARCHAR(50),
IN para_mobile_token VARCHAR(50),
IN para_registration_id BIGINT(20),
IN para_gps_provider VARCHAR(50), 
IN para_gps_location_provider VARCHAR(50),
IN para_gps_time decimal(15,1),
IN para_gps_latitude decimal(15,7),
IN para_gps_longitude decimal(15,7),
IN para_gps_accuracy decimal(15,7),
IN para_gps_speed DECIMAL(15,7),
IN para_gps_altitude DECIMAL(15,7),
IN para_gps_bearing DECIMAL(15,7),
IN para_mobile_apps_version VARCHAR(50),
IN para_mobile_source_ip VARCHAR(50),
IN para_mobile_datetime datetime,
IN para_status INT
)
BEGIN
	DECLARE v_district_id BIGINT;
	DECLARE v_region_code VARCHAR(50);
	DECLARE v_district_name_eng VARCHAR(50);
	DECLARE v_district_name_chn VARCHAR(50);
	DECLARE v_center_latitude DECIMAL(15,7);
	DECLARE v_center_longitude DECIMAL(15,7);
	DECLARE v_diff DECIMAL(15,7);
	DECLARE done INT DEFAULT FALSE;
	DECLARE cur1 CURSOR FOR 
	SELECT district_id,region_code,district_name_eng,district_name_chn,
	center_latitude,
	center_longitude,
	(lat_diff + long_diff) AS diff
	 FROM 
	(SELECT district_id,region_code,district_name_eng,district_name_chn,
	center_latitude,IF(center_latitude>para_gps_latitude, center_latitude-para_gps_latitude, para_gps_latitude-center_latitude) AS lat_diff, 
	center_longitude,
	IF(center_longitude >para_gps_longitude, center_longitude-para_gps_longitude, para_gps_longitude-center_longitude ) AS long_diff
	FROM tbl_oms_geo_district_master)  AS sb
	ORDER BY diff LIMIT 1 ;
	DECLARE CONTINUE HANDLER FOR NOT FOUND SET done = 1;
	OPEN cur1;
	read_loop: LOOP
	IF done THEN
	LEAVE read_loop;
	END IF;
	FETCH cur1 INTO v_district_id,v_region_code,v_district_name_eng,v_district_name_chn,
					v_center_latitude,v_center_longitude,v_diff;
	END LOOP;
	
	IF EXISTS (SELECT driver_user_id FROM tbl_rosf_driver_online_gps WHERE driver_user_id = para_driver_user_id) 
	THEN
		UPDATE tbl_rosf_driver_online_gps 
			SET 
